import style from './Card.module.css'

const Card = ({name, status, species, gender, origin, image, onClose}) => {   
   return (
      <div className={style.contenedor}>
         <img src={image} alt=''/>
         <button className={style.button} onClick={onClose}>X</button>
         <h2 className={style.letter}><i>Name:</i> {name}</h2>
         <h2><i>Status:</i> {status}</h2>
         <h2><i>Species:</i> {species}</h2>
         <h2><i>Gender:</i> {gender}</h2>
         <h2><i>Origin:</i> {origin}</h2>

      </div>
   );
}

export default Card
